select(2, ...).LoadData("APP_INFO","Global",[[return {version=404,lastSync=1589794919,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.35 Changelog",content="TSM v4.9.35 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Fixed error when loading very old settings<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1589397480,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-35-changelog/"},{title="TradeSkillMaster v4.9.34 Changelog",content="TSM v4.9.34 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Tweaked how TSM stores item info and settings<br />* [Retail] Fixed issue with auctions not displaying when the user has a token posted<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1589133504,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-34-changelog/"},{title="TradeSkillMaster v4.9.33 Changelog",content="TSM v4.9.33 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [All] Updated hard-coded vendor sell prices for crafting mats<br />* [All] Fixed issue with Accounting incorrectly reporting unique items which couldn't be retrieved from the mail<br />* [Retail] Fixed errors when using the queue with a garrison profession open<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1588699578,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-33-changelog/"},{title="Get 30 Days of free TSM Premium!",content="We understand that you may have some extra time available at the moment, and World of Warcraft may even be a welcome escape. If you're looking to obtain the sought after Brutosaur mount or are currently focusing your energy on kickstarting your gold-making activities, we wanted to strengthen your efforts with 30 free days of [...]",timestamp=1588356565,link="https://blog.tradeskillmaster.com/get-30-days-of-free-tsm-premium/"},{title="Sniping with TSM in 8.3",content="Since the new Auction House changes went live in patch 8.3, we wanted to clarify some of the changes in fuctionality to the Sniper feature in TradeSkillMaster. One of the biggest underlying changes, which was referenced in the blog post earlier this year, is that the AH no longer has &#8216;pages'. Before 8.3 you could [...]",timestamp=1587744735,link="https://blog.tradeskillmaster.com/sniping-with-tsm-in-8-3/"}}}]]) --<APP_INFO,Global,1589794919>
